import { useEffect, useState } from "react";
import ReactDateInputs from "react-date-inputs";
import {
  BarChart,
  Bar,
  XAxis,
  YAxis,
  Tooltip,
  CartesianGrid,
  Legend,
} from "recharts";
function App() {
  const time5=[];
  const [data10,setData10]=useState([
    {
      "time": '9am to 12am',
      "count": 0
    },
    {
      "time": '12pm to 3pm',
      "count": 0
    },
    {
      "time": '3pm to 6pm',
      "count": 0
    },
    {
      "time": '6pm to 9pm',
