    //   console.log(data6[j]);
    // }
    // //  if(data6[j].schedule_time.slice(0,10)===e.activeLabel)
    // //  {
    // //    var time3=data6[j].schedule_time;
    // //   //  console.log(data6[j].schedule_time)
    // //   //  if(data6[j].item_date===date)
    // //   //  {
    // //   //   data7.push(data6[j]);
    // //   //   time5.push(time3);
    // //   //  }
    // //  }
    // }
    // console.log(data7);
    // for(let m=0; m<data7.length; m++){

    //   console.log(time5[0]);
    // }


  }

  return (
    <div className="App">
      <button
        onClick={async () => {
          await fetch("http://localhost:8000/data")
            .then((res) => {
              if (!res.ok) {
                throw Error("Not able to fetch from the given end point");
              }
              return res.json();
            })
            .then((data) => {
              try {
                setData(data);
              } catch (e) {
                console.log(e);
              }
              {
                console.log(data[0].item_date);
              }
            })
            .catch((err) => {
              console.log(err);
            });
        }}
      >
        Hiii
      </button>

      {/* <ReactDateInputs value={date} onChange={setDate} /> */}
      <input
        type="date"
        onChange={(e) => {
          setLoading(false);
          setData4([]);
          setDate(e.target.value);
        }}
      ></input>

      {console.log(date)}
      <button
        onClick={() => {
          handleClick();
        }}
      >
        click
      </button>
      {loading && console.log(data4)}
      {loading && (
        <BarChart width={730} height={250} data={data4} onClick={(e)=>{handleClick2(e)}}>
          <CartesianGrid strokeDasharray="3 3" />
          <XAxis dataKey="date" />
          <YAxis />
          <Tooltip />
          <Legend />
          <Bar dataKey="count" fill="#8884d8" />
        </BarChart>
      )}
      {loading2 && (
        <BarChart width={730} height={250} data={data10}>
          <CartesianGrid strokeDasharray="3 3" />
          <XAxis dataKey="time" />
          <YAxis />
          <Tooltip />
          <Legend />
          <Bar dataKey="count" fill="#8884d8" />
        </BarChart>
      )}
    </div>
  );
}

export default App;
